import React, { Component } from "react";
import "./Landing.css";

export default class Landing extends Component {
  render() {
    return (
      <Image
        source={require("path/to/image.png")}
        style={styles.backgroundImage}
        resizeMode={Image.resizeMode.stretch}
      />
    );
  }
}
